  \"2016-07-27T22:44:28.887846\",\n\t\"name\": \"ecological-assessment-of-the-usdi-fish-and-wildlife-services-kirtlands-warbler-management-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Kirtlandu2019s Warbler Wildlife Management
  Area (KWWMA) is an assemblage of 124 stands totaling 6,582 ac (2,264 ha), all located
  within eight counties of the northern Lower Peninsula of Michigan. Many of these
  stands are adjacent to existing jack pine forest ecosystems owned and managed by
  the Michigan Department of Natural Resources (MDNR). The characteristics of these
  tracts, however, are varied. Almost half of the area of the KWWMA is currently dominated
  by jack pine that is 5-23 years old, which is the preferred habitat of breeding
  Kirtlandu2019s Warbler. Our analysis suggests that many of these stands are not
  optimally stocked to provide high-quality Kirtlandu2019s Warbler habitat. However,
  songbird surveys on a subset of KWWMA stands in 2006 show that these stands do provide
  some habitat that is conducive for breeding Kirtlandu2019s Warblers. Furthermore,
  the diversity of habitats, both in terms of stand age and species composition and
  structure, suggest that a variety of songbird species, many of which are of conservation
  concern, are utilizing these habitats. This suggests that the KWWMA may contribute
  significantly to avifaunal productivity and diversity in northern Lower Michigan.\",\n\t\"license_title\":
